// DoctorProfile.jsx
import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import axios from 'axios';
import Header from './Header';
import { FaUserMd, FaPhone, FaBirthdayCake, FaVenusMars, FaTint, FaNotesMedical, FaFileAlt } from 'react-icons/fa';
// import styles from './DoctorProfile.module.css';

const InfoItem = ({ icon, label, value }) => (
  <div className={styles.infoItem}>
    {icon}
    <div className={styles.infoContent}>
      <span className={styles.infoLabel}>{label}</span>
      <span className={styles.infoValue}>{value}</span>
    </div>
  </div>
);

export default function DoctorProfile() {
  const [patientData, setPatientData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const { id } = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    async function fetchPatientData() {
      try {
        const response = await axios.get(`http://localhost:3001/en/getpatient/${id}`);
        setPatientData(response.data);
        setIsLoading(false);
      } catch (error) {
        console.error('Error fetching patient data:', error);
        setIsLoading(false);
      }
    }

    fetchPatientData();
  }, [id]);

  const handleFileClick = (file) => {
    navigate(`/reportdoctor/${file}`);
  };

  const handleBack = () => {
    navigate(-1);
  };

  if (isLoading) {
    return <div className={styles.loading}>Loading patient details...</div>;
  }

  return (
    <div className={styles.doctorProfile}>
      <Header />
      <div className={styles.profileContainer}>
        <header className={styles.profileHeader}>
          <h1>Patient Details</h1>
          <button onClick={handleBack} className={styles.backButton}>Back</button>
        </header>
        
        <main className={styles.profileMain}>
          <section className={styles.patientInfo}>
            <h2>Patient Information</h2>
            <div className={styles.infoGrid}>
              <InfoItem icon={<FaUserMd />} label="ID" value={patientData._id} />
              <InfoItem icon={<FaUserMd />} label="Name" value={patientData.name} />
              <InfoItem icon={<FaPhone />} label="Phone" value={patientData.phoneNumber} />
              <InfoItem icon={<FaBirthdayCake />} label="DOB" value={new Date(patientData.DOB).toLocaleDateString()} />
              <InfoItem icon={<FaVenusMars />} label="Gender" value={patientData.gender} />
              <InfoItem icon={<FaTint />} label="Blood Group" value={patientData.bloodGroup} />
              <InfoItem icon={<FaNotesMedical />} label="Chronics" value={patientData.chronics.join(', ')} />
            </div>
          </section>

          <section className={styles.reportHistory}>
            <h2>Report History</h2>
            <div className={styles.fileList}>
              {patientData?.reportsList && patientData.reportsList.length > 0 ? (
                patientData.reportsList.map((file, index) => (
                  <div key={index} className={styles.fileItem} onClick={() => handleFileClick(file)}>
                    <FaFileAlt className={styles.fileIcon} />
                    <span>File ID: {file}</span>
                  </div>
                ))
              ) : (
                <p>No reports found.</p>
              )}
            </div>
          </section>
        </main>
      </div>
    </div>
  );
}
